INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 5118061, 40, "ペコリーヌとの出会い", 0, 2, "フリーマーケット会場", "青空の下で謁見", 10118, 2834);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 5118062, 40, "マホとの出会い", 0, 2, "フリーマーケット会場", "未来の騎空団\nマスコット？", 10118, 2835);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 5118063, 40, "アキノとの出会い", 0, 2, "ランドソル市街地", "お嬢さまからの\n緊急依頼", 10118, 2837);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 5118064, 40, "ジュンとの出会い", 0, 2, "フリーマーケット会場", "黄金色の悩みごと", 10118, 4108402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 5118065, 40, "カオリとの出会い", 0, 2, "フリーマーケット会場", "白熱！　格闘大会！", 10118, 4107402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 1, 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 5118066, 40, "ニノンとの出会い", 0, 2, "オーエド町", "祭り太鼓はオーエドの華", 10118, 9000227);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 5118067, 40, "スズナとの出会い", 0, 3, "フリーマーケット会場", "人気者は遅れて\nやってくる", 10118, 2101181);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 5118068, 40, "ナナカとの出会い", 0, 3, "ランドソル市街地", "巫女・ミーツ・魔法少女", 10118, 4109402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 5118069, 40, "キャル＆コッコロとの出会い", 0, 3, "フリーマーケット会場", "ネズ耳は二度なくなる", 10118, 4305402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 5118070, 40, "ユカリとの出会い", 0, 3, "ランドソル市街地", "この出会いにカンパイ！", 10118, 4101402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 0, 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 5118071, 40, "アオイとの出会い", 0, 3, "ランドソル市街地", "陰陽アンサンブル", 10118, 4106402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 8, 91002, 1, 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 5118072, 40, "シノブとの出会い", 0, 3, "フリーマーケット会場", "運試し十番勝負！", 10118, 2836);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (0, 0, 0, 0, 0, 0, 5118600, 0, "オープニング", 10145115, 1, 0, "彼女たちの新たな日常", 10118, 0);
